import "./footer.scss";
const Footer = () => {
    return ( 
        <footer className="d-flex flex-wrap justify-content-between align-items-center  gum-foot">
            <p className="col-md-4 mb-0 text-muted">&copy; 2021 <a href="http://www.klinsheet.com"></a>. All rights reserved.</p>
        </footer>
     );
}

export default Footer;
